import Title from "./stranich/title"
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link,
  BrowserRouter,

} from "react-router-dom";

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<Title/>}/>
      </Routes>
    </BrowserRouter>
  );
}

export default App;
